import { useState } from 'react';

function App() {
  // 1. State for Form Data
  const [formData, setFormData] = useState({
    Age: '',
    Sex: '1',
    'Chest pain type': '',
    BP: '',
    Cholesterol: '',
    'FBS over 120': '0',
    'EKG results': '',
    'Max HR': '',
    'Exercise angina': '0',
    'ST depression': '',
    'Slope of ST': '',
    'Number of vessels fluro': '',
    Thallium: ''
  });

  // 2. State for Result
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // 3. Handle Input Change
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  // 4. Handle Submit
  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setResult(null);

    try {
      const response = await fetch('http://127.0.0.1:5000/predict', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });

      if (!response.ok) throw new Error(`Server error: ${response.statusText}`);

      const data = await response.json();
      setResult(data);

    } catch (err) {
      console.error(err);
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
      <div className="min-h-screen bg-gray-100 flex items-center justify-center p-4 font-sans text-gray-800">
        <div className="bg-white p-8 rounded-lg shadow-xl w-full max-w-2xl">
          <h2 className="text-3xl font-bold text-center text-blue-600 mb-2">Heart Disease Predictor</h2>
          <p className="text-center text-gray-500 mb-6">Enter patient details for risk assessment</p>

          {/* The Form */}
          <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-6">

            {/* Age */}
            <div className="col-span-1">
              <label className="block text-sm font-medium text-gray-700 mb-1">Age</label>
              <input type="number" name="Age" value={formData.Age} onChange={handleChange} required
                     className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            {/* Sex */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Sex</label>
              <select name="Sex" value={formData.Sex} onChange={handleChange}
                      className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              >
                <option value="1">Male</option>
                <option value="0">Female</option>
              </select>
            </div>

            {/* Chest Pain */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Chest Pain Type</label>
              <input type="number" name="Chest pain type" value={formData['Chest pain type']} onChange={handleChange} required
                     className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            {/* BP */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">BP</label>
              <input type="number" name="BP" value={formData.BP} onChange={handleChange} required
                     className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            {/* Cholesterol */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Cholesterol</label>
              <input type="number" name="Cholesterol" value={formData.Cholesterol} onChange={handleChange} required
                     className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            {/* FBS */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">FBS > 120</label>
              <select name="FBS over 120" value={formData['FBS over 120']} onChange={handleChange}
                      className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              >
                <option value="0">No</option>
                <option value="1">Yes</option>
              </select>
            </div>

            {/* EKG */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">EKG Results</label>
              <input type="number" name="EKG results" value={formData['EKG results']} onChange={handleChange} required
                     className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            {/* Max HR */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Max HR</label>
              <input type="number" name="Max HR" value={formData['Max HR']} onChange={handleChange} required
                     className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            {/* Exercise Angina */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Exercise Angina</label>
              <select name="Exercise angina" value={formData['Exercise angina']} onChange={handleChange}
                      className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              >
                <option value="0">No</option>
                <option value="1">Yes</option>
              </select>
            </div>

            {/* ST Depression */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">ST Depression</label>
              <input type="number" step="0.1" name="ST depression" value={formData['ST depression']} onChange={handleChange} required
                     className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            {/* Slope of ST */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Slope of ST</label>
              <input type="number" name="Slope of ST" value={formData['Slope of ST']} onChange={handleChange} required
                     className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            {/* Number of vessels */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Vessels fluro</label>
              <input type="number" name="Number of vessels fluro" value={formData['Number of vessels fluro']} onChange={handleChange} required
                     className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            {/* Thallium */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Thallium</label>
              <input type="number" name="Thallium" value={formData.Thallium} onChange={handleChange} required
                     className="w-full border-gray-300 border rounded-md p-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>

            <div className="col-span-1 md:col-span-2">
              <button type="submit" disabled={loading}
                      className={`w-full text-white font-bold py-3 px-4 rounded transition duration-300 
                ${loading ? 'bg-gray-400 cursor-not-allowed' : 'bg-blue-600 hover:bg-blue-700'}`}
              >
                {loading ? 'Analyzing...' : 'Predict Risk'}
              </button>
            </div>
          </form>

          {/* Result Box */}
          {error && (
              <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative" role="alert">
                <strong className="font-bold">Error: </strong>
                <span className="block sm:inline">{error}</span>
              </div>
          )}

          {result && (
              <div className={`p-4 rounded border text-center font-bold text-xl shadow-inner ${
                  result.prediction === 1
                      ? 'bg-red-100 border-red-400 text-red-800'
                      : 'bg-green-100 border-green-400 text-green-800'
              }`}>
                {result.prediction === 1
                    ? `High Risk Detected! (Confidence: ${result.probability}%)`
                    : `Low Risk Detected. (Confidence: ${result.probability}%)`
                }
              </div>
          )}
        </div>
      </div>
  );
}

export default App;
